import React from "react";
import "../css/Test.css";

function Test() {
  return (
    <div className="test">
      <div className="test-header"></div>
      <div className="test-question"></div>
      <div className="test-options"></div>
      <div className="test-navigator"></div>
    </div>
  );
}

export default Test;
